import React from "react";
import "./Guide.css";
import { Container, Col, Row, Button } from "react-bootstrap";

const Guide = () => {
  return <div>
    <div className='title'>
      <h5>Wine Quide</h5>
      <hr></hr>
    </div>
  </div>;
};

export default Guide;
